import React, {FC} from 'react';
import './App.css';

const App: FC = () => {
  return (
    <div className="App">
      <div className="header">
          <input type="text" placeholder="Task..." />
          <input type="number" placeholder="Task..." />
      </div>
      <div className="todolist">
      </div>
    </div>
  );
}

export default App;
